import React, { Component } from "react";
import { Form, Container, Button } from "react-bootstrap";
export default class Lugares extends Component {
    state = {}
    render() {
        return (
            <div>
                <Container>
                <Form.Control
                    type="text"
                    id="inputText1"/>
                </Container>
                <Button>Buscar</Button>
            </div>
        )
    }
}
